import React from "react";
const Filtered=()=>{
    const names=['james','john','july','karthik','rajesh','joshna'];
    const filtered=names.filter(item=>item.includes('j'));
    return(
        <div>
            <h1>Filter</h1>
            {
                filtered.map(item=><li>{item}</li>)
            }
        </div>
    )
}
export default Filtered
